import Vue from 'vue'
import Component from 'vue-class-component'
import { Provide } from 'vue-property-decorator'
import { NavList } from '../../utils/models/interface'

@Component({

})
export default class Nav extends Vue {
  index: Number = 0;
  firstNavList: Array<NavList> = [
    {
      value: '关于QG',
      label: '',
      children: [],
      isAcitve: true
    },
    {
      value: '我们',
      label: '',
      children: [],
      isAcitve: false
    },
    {
      value: '成员',
      label: '',
      children: [],
      isAcitve: false
    },
    {
      value: '项目',
      label: '',
      children: [],
      isAcitve: false
    },
    {
      value: '荣誉',
      label: '',
      children: [],
      isAcitve: false
    },
    {
      value: '专栏',
      label: '',
      children: [],
      isAcitve: false
    },
  ];

  switchFirstNav(event: any) {
    let target: any = event.target,
        index = target.getAttribute('data-index');
    if (!index) {
      // 点击到父容器
      return ;
    }
    for (let i = 0; i < this.$data.firstNavList.length; i++) {
      this.$data.firstNavList[i].isAcitve = false;
    }
    this.$data.firstNavList[index].isAcitve = true;

    this.$data.firstNavList.push(this.$data.firstNavList.pop());
  }
}
